<template>
  <img class='image' src="data:image/png;base64,">
  <div>
    <div class="Wrap4">
    <div v-if='Logged'>
      <div class="Welcome"><h1>Welcome, {{this.username}} </h1></div>
      <button class="btn" @click="logout">Exit</button>
  
    </div>
    <div v-else>
      <label>Sign Up</label>
      <input type="text" v-model="username"/>
      <button class="btn" @click="login">Continue</button>
    </div>
  </div>
  </div>
</template>

<script>

export default {
  name: 'TheHome',
  data(){
    return{
      Logged: false,
      username: ''
    }
  },

  created(){
    if(localStorage.getItem('Logged')){
      this.Logged=true,
      this.username=localStorage.getItem("username")
    }
  
  },
  methods: {
    login(){
      if(this.username !== ''){
        console.log (this.username);
        localStorage.setItem('Logged', true)
        localStorage.setItem('username', this.username)
        this.Logged=true

      }else{
      console.log(' ')
    }
  },
  logout(){
    this.Logged=false,
    this.username=''
    localStorage.removeItem('Logged')
    localStorage.removeItem('username')
  }
}}

    
</script>

<style>
.image{
  height: 15vh;
}

.Welcome{
  color: rgb(212, 194, 194);
  font-size: 25px;
}

.btn {
  display: inline-block;
  box-sizing: border-box;
  padding: 0 35px;
  margin: 0 15px 15px 0;
  outline: none;
  border: none;
  border-radius: 4px;
  height: 36px;
  position: relative;
  vertical-align: top;
  background-color: rgb(192, 201, 151);
  font-size: 20px;
  cursor: pointer;
  margin: 0;
  position: absolute;
  top: 50%;
  left: 50%;
  -ms-transform: translate(-50%, -50%);
  transform: translate(-50%, -50%);
  margin-top: 13vh;
 
}

.Wrap4{
  position: relative;
}

label{
  color: rgb(212, 194, 194);
  font-size: 25px;
  margin: 0;
  position: absolute;
  top: 15%;
  left: 50%;
  -ms-transform: translate(-50%, -50%);
  transform: translate(-50%, -50%);
  font-size: 40px;
}

input{
  margin-top: 6vh;
  height: 3vh;
  width: 50vh;
  background-color:rgb(167, 185, 185);
  margin-left: 15px;
}


</style>
